UE already supports "Inline Sub Objects", that is UCLASS marked with DefaultToInstanced specifier . Editor would try to create new sub objects inline for these classes' references, rather than points to a existing one. It's also a way of doing data polymorphism in UE. Given a simple class hierarchy like this: // DcJsonAssetTests/Private/DcTestImports2.h
UCLASS(BlueprintType, EditInlineNew, DefaultToInstanced)
class UDcJsonAsset_BaseShape : public UObject // ... UPROPERTY(EditAnywhere) FName ShapeName;
}; UCLASS()
class UDcJsonAsset_ShapeBox : public UDcJsonAsset_BaseShape // ... UPROPERTY(EditAnywhere) float Height; UPROPERTY(EditAnywhere) float Width;
}; UCLASS()
class UDcJsonAsset_ShapeSquare : public UDcJsonAsset_BaseShape // ... UPROPERTY(EditAnywhere) float Radius;
}; An asset can be loaded from a JSON like this: // DcJsonAssetTests/Private/DcTestImports2.h
UCLASS()
class UDcJsonAssetTestDataAsset4_SubObjects : public UDcImportedDataAsset { UPROPERTY(EditAnywhere) UDcJsonAsset_BaseShape* ShapeField1; UPROPERTY(EditAnywhere) UDcJsonAsset_BaseShape* ShapeField2; UPROPERTY(EditAnywhere) UDcJsonAsset_BaseShape* ShapeField3;
}; // DcJsonAsset/Tests/DcJsonFixture_SubObjects.json
{ "$type" : "DcJsonAssetTestDataAsset4_SubObjects", "ShapeField1" : { "$type" : "DcJsonAsset_ShapeBox", "ShapeName" : "MyBox", "Height" : 43, "Width" : 25 }, "ShapeField2" : { "$type" : "DcJsonAsset_ShapeSquare", "Radius" : 16 }, "ShapeField3" : null
}

